        }
    }, [initialized, keycloak.authenticated]);

    const handleLogout = () => {
        keycloak.logout();
    };

    return (
        <div>
            {initialized && keycloak.authenticated ? ( 
                <div>
                    <h1>Welcome, {keycloak.idTokenParsed.preferred_username}</h1> 
                    <button onClick={handleLogout}>Logout</button> 
                </div>
            ) : (
                <h1>Please login to view this page</h1> 
            )}
        </div>
    );
};

export default Home;
